script: |
  super -f text -I q1739.spq | sort > q1739.out

inputs:
  - name: q1739.spq
    data: |
      SELECT * FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT + ( + 58 ) * - ( - col1 ) * - + col0 + + 76 BETWEEN + col0 * - col1 AND CAST ( + - col1 AS REAL ) * - 81 * - - 70 - 45 + - col2;
  - name: tab1

outputs:
  - name: q1739.out
    data: |
      51	14	96
      85	5	59
      91	47	68
